nded shoulders","round shoulder fix","exercises for rounded shoulders","stretches to fix rounded shoulders","bad posture exercises","exercises for bad posture","how to get good posture","athleanx","athlean x","jeff cavaliere"],"channelId":"UCe0TLA0EsQbE-MjuHXevj2A","isOwnerViewing":false,"shortDescription":"Do you have a forward head or slumped posture that you wish you could fix?  If so, you will definitely want to watch this video.  I’m going to show you how to fix a forward head and rounded shoulders the right way by focusing on what is really causing these problems.  Here’s a hint.  If you followed other posture correction videos for a forward head you likely never fixed the root of the issue and only did a temporary solution.\n\n60% off all AX programs - http://athleanx.com/x/43-workouts\nSubscribe to this channel here - http://youtube.com/user/jdcav24\n\nWhen trying to correct any issue in the body, it is good practice to not focus on the site of the issues when looking for the solution.  Instead, you need to look for the source.  For instance, when it comes to fixing the position of the head and neck you cannot just look at the muscles that surround the area for the answer to your problems.\n\nThis is especially true if you realize that the neck is just a portion of the spine.  The spine is an incredibly long structure that has elements in the neck, mid back and lower back.  Doing anything to a region of the spine down below is going to have repercussions on the levels above by virtue of the fact that it is one big interconnected chain.\n\nThat said, the positioning of the neck into a craned position is often the result of a compensation of the eyes to make sure we are looking straight ahead.  When the thoracic spine is excessively curved below we wind up rounding forward, with our head following.  This takes our eyesight line down towards the ground.  The craning of the neck back to horizontal is simply a reaction to the position of the thoracic rounding and not necessarily something in need of fixing directly.\n\nThe same can be said of the lumbar spine and pelvis.  If you place your pelvis into posterior tilt, you will affect the position of the thoracic spine as well.  This is once again due to the connectedness of the entire spine as a whole.  The key is to try and break this pattern up.  You want to reverse the excessive posterior tilt and restore lost extension into the thoracic spine.  When this happens, the cervical spine will often times correct itself.  \n\nTo work on doing this you will want to do the exercises shown here.  First, to mobilize the area of the thoracic spine that is most restricted while at the same time establishing proper pelvic position you would do the bench mobility combo demonstrated.  From here, you want to hold the position for a minute which is going to provide not just mobility to the tight areas but an isometric challenge to the deep flexors of the neck which tend to get weak over time from adaptations of the faulty posture.\n\nIf you’re just beginning, one minute three times per day of the first variation is enough.  If you are more advanced you can place the arms overhead for more of a thoracic mobility challenge.  Finally, the most advanced can add a weight plate to the front of the head for additional neck flexor strengthening.\n\nFinally, you want to reinforce the corrections you make with the use of a face pull overhead raise.  The addition of the overhead raise helps to hit the lower traps which will restore normal positioning of the shoulders and correct the forward rounding that promotes the neck adapatations in the first place.\n\nFor a complete program that puts the science back in strength, head to the link below and check out the ATHLEAN-X Training Programs.  Train like an athlete and overlook nothing in your workouts and nutrition.\n\nFor more videos on how to fix anterior pelvic tilts and the best way to get perfect posture, be sure to subscribe to our channel below and turn on your notifications so you never miss a new video when it’s published.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/YLR2Vm346Lc/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB4457dQw1hEkoUk7QZvirl0QslLw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/YLR2Vm346Lc/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB3uPMPOYr7ZDKyIzZqmnWbIrpUkQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/YLR2Vm346Lc/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAqOye4IcJiofPkYN1Qq-0HD_ibpA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/YLR2Vm346Lc/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCNcaJPSlVg-cY42zWK8PpzEVuR4g","width":336,"height":188},{"url":"https://i.ytimg.com/vi/YLR2Vm346Lc/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"4407632","author":"ATHLEAN-X™","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"565000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/e0TLA0EsQbE-MjuHXevj2A/featured_channel.jpg?v=632fce9c","width":40,"height":40}]},"trackingParams":"CGUQ8zciEwigiezYtu2HAxUCTbgEHUpaL6U=","navigationEndpoint":{"clickTrackingParams":"CGUQ8zciEwigiezYtu2HAxUCTbgEHUpaL6UyAml2","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCe0TLA0EsQbE-MjuHXevj2A","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCe0TLA0EsQbE-MjuHXevj2A"}},"channelName":"ATHLEAN-X™","subscribeButton":{"subscribeButtonRenderer":{"buttonText":{"runs":[{"text":"SUBSCRIBE"}]},"subscribed":false,"enabled":true,"type":"FREE","channelId":"UCe0TLA0EsQbE-MjuHXevj2A","showPreferences":false,"subscribedButtonText":{"runs":[{"text":"SUBSCRIB }]},"embed":{"iframeUrl":"https://www.youtube.com/embed/YLR2Vm346Lc","width":1280,"height":720},"title":{"simpleText":"How to Fix Forward Head | Slumped Posture (PERMANENTLY!)"},"description":{"simpleText":"Do you have a forward head or slumped posture that you wish you could fix?  If so, you will definitely want to watch this video.  I’m going to show you how to fix a forward head and rounded shoulders the right way by focusing on what is really causing these problems.  Here’s a hint.  If you followed other posture correction videos for a forward head you likely never fixed the root of the issue and only did a temporary solution.\n\n60% off all AX programs - http://athleanx.com/x/43-workouts\nSubscribe to this channel here - http://youtube.com/user/jdcav24\n\nWhen trying to correct any issue in the body, it is good practice to not focus on the site of the issues when looking for the solution.  Instead, you need to look for the source.  For instance, when it comes to fixing the position of the head and neck you cannot just look at the muscles that surround the area for the answer to your problems.\n\nThis is especially true if you realize that the neck is just a portion of the spine.  The spine is an incredibly long structure that has elements in the neck, mid back and lower back.  Doing anything to a region of the spine down below is going to have repercussions on the levels above by virtue of the fact that it is one big interconnected chain.\n\nThat said, the positioning of the neck into a craned position is often the result of a compensation of the eyes to make sure we are looking straight ahead.  When the thoracic spine is excessively curved below we wind up rounding forward, with our head following.  This takes our eyesight line down towards the ground.  The craning of the neck back to horizontal is simply a reaction to the position of the thoracic rounding and not necessarily something in need of fixing directly.\n\nThe same can be said of the lumbar spine and pelvis.  If you place your pelvis into posterior tilt, you will affect the position of the thoracic spine as well.  This is once again due to the connectedness of the entire spine as a whole.  The key is to try and break this pattern up.  You want to reverse the excessive posterior tilt and restore lost extension into the thoracic spine.  When this happens, the cervical spine will often times correct itself.  \n\nTo work on doing this you will want to do the exercises shown here.  First, to mobilize the area of the thoracic spine that is most restricted while at the same time establishing proper pelvic position you would do the bench mobility combo demonstrated.  From here, you want to hold the position for a minute which is going to provide not just mobility to the tight areas but an isometric challenge to the deep flexors of the neck which tend to get weak over time from adaptations of the faulty posture.\n\nIf you’re just beginning, one minute three times per day of the first variation is enough.  If you are more advanced you can place the arms overhead for more of a thoracic mobility challenge.  Finally, the most advanced can add a weight plate to the front of the head for additional neck flexor strengthening.\n\nFinally, you want to reinforce the corrections you make with the use of a face pull overhead raise.  The addition of the overhead raise helps to hit the lower traps which will restore normal positioning of the shoulders and correct the forward rounding that promotes the neck adapatations in the first place.\n\nFor a complete program that puts the science back in strength, head to the link below and check out the ATHLEAN-X Training Programs.  Train like an athlete and overlook nothing in your workouts and nutrition.\n\nFor more videos on how to fix anterior pelvic tilts and the best way to get perfect posture, be sure to subscribe to our channel below and turn on your notifications so you never miss a new video when it’s published."},"lengthSeconds":"58 arams":"COEBEM2rARgBIhMI0ZXs2LbthwMVNAoeAB097QUW","defaultExpanded":false,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"COEBEM2rARgBIhMI0ZXs2LbthwMVNAoeAB097QUW","commandExecutorCommand":{"commands":[{"clickTrackingParams":"COEBEM2rARgBIhMI0ZXs2LbthwMVNAoeAB097QUW","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"COEBEM2rARgBIhMI0ZXs2LbthwMVNAoeAB097QUW","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"COEBEM2rARgBIhMI0ZXs2LbthwMVNAoeAB097QUW","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Do you have a forward head or slumped posture that you wish you could fix?  If so, you will definitely want to watch this video.  I’m going to show you how to fix a forward head and rounded shoulders the right way by focusing on what is really causing these problems.  Here’s a hint.  If you followed other posture correction videos for a forward head you likely never fixed the root of the issue and only did a temporary solution.\n\n60% off all AX programs - http://athleanx.com/x/43-workouts\nSubscribe to this channel here -    / jdcav24  \n\nWhen trying to correct any issue in the body, it is good practice to not focus on the site of the issues when looking for the solution.  Instead, you need to look for the source.  For instance, when it comes to fixing the position of the head and neck you cannot just look at the muscles that surround the area for the answer to your problems.\n\nThis is especially true if you realize that the neck is just a portion of the spine.  The spine is an incredibly long structure that has elements in the neck, mid back and lower back.  Doing anything to a region of the spine down below is going to have repercussions on the levels above by virtue of the fact that it is one big interconnected chain.\n\nThat said, the positioning of the neck into a craned position is often the result of a compensation of the eyes to make sure we are looking straight ahead.  When the thoracic spine is excessively curved below we wind up rounding forward, with our head following.  This takes our eyesight line down towards the ground.  The craning of the neck back to horizontal is simply a reaction to the position of the thoracic rounding and not necessarily something in need of fixing directly.\n\nThe same can be said of the lumbar spine and pelvis.  If you place your pelvis into posterior tilt, you will affect the position of the thoracic spine as well.  This is once again due to the connectedness of the entire spine as a whole.  The key is to try and break this pattern up.  You want to reverse the excessive posterior tilt and restore lost extension into the thoracic spine.  When this happens, the cervical spine will often times correct itself.  \n\nTo work on doing this you will want to do the exercises shown here.  First, to mobilize the area of the thoracic spine that is most restricted while at the same time establishing proper pelvic position you would do the bench mobility combo demonstrated.  From here, you want to hold the position for a minute which is going to provide not just mobility to the tight areas but an isometric challenge to the deep flexors of the neck which tend to get weak over time from adaptations of the faulty posture.\n\nIf you’re just beginning, one minute three times per day of the first variation is enough.  If you are more advanced you can place the arms overhead for more of a thoracic mobility challenge.  Finally, the most advanced can add a weight plate to the front of the head for additional neck flexor strengthening.\n\nFinally, you want to reinforce the corrections you make with the use of a face pull overhead raise.  The addition of the overhead raise helps to hit the lower traps which will restore normal positioning of the shoulders and correct the forward rounding that promotes the neck adapatations in the first place.\n\nFor a complete program that puts the science back in strength, head to the link below and check out the ATHLEAN-X Training Programs.  Train like an athlete and overlook nothing in your workouts and nutrition.\n\nFor more videos on how to fix anterior pelvic tilts and the best way to get perfect posture, be sure to subscribe to our channel below and turn on your notifications so you never miss a new video when it’s published.","commandRuns":[{"startIndex":459,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"COEBEM2rARgBIhMI0ZXs2LbthwMVNAoeAB097QUWSLfR4-_myp3aYA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbm9oYnYtM2M2dTMyY0d3RkE5RUNNeWh0WEMwUXxBQ3Jtc0ttT3NoWjVwU3NfM25zcmYyUHJLeS1NSjdWWkE1X3BYbUl1T0Z5Q09sc0FmNUxhWjF6bWl3VmhxYVI0VXRWbThZenBILTFMNTFGRDAxT3lmVXRrVDVLUHRIVTZfWmloallfa21sVWFxc2h4REthQlBOMA\u0026q=http%3A%2F%2Fathleanx.com%2Fx%2F43-workouts\u0026v=YLR2Vm346Lc","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbm9oYnYtM2M2dTMyY0d3RkE5RUNNeWh0WEMwUXxBQ3Jtc0ttT3NoWjVwU3NfM25zcmYyUHJLeS1NSjdWWkE1X3BYbUl1T0Z5Q09sc0FmNUxhWjF6bWl3VmhxYVI0VXRWbThZenBILTFMNTFGRDAxT3lmVXRrVDVLUHRIVTZfWmloallfa21sVWFxc2h4REthQlBOMA\u0026q=http%3A%2F%2Fathleanx.com%2Fx%2F43-workouts\u0026v=YLR2Vm346Lc","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":526,"length":14,"onTap":{"innertubeCommand":{"clickTrackingParams":"COEBEM2rARgBIhMI0ZXs2LbthwMVNAoeAB097QUW","commandMetadata":{"webCommandMetadata":{"url":"http://youtube.com/user/jdcav24","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"http://youtube.com/user/jdcav24","nofollow":true}}},"onTapOptions nelNavigationEndpoint":{"clickTrackingParams":"CBsQ040EGAQiEwjRlezYtu2HAxU0Ch4AHT3tBRY=","commandMetadata":{"webCommandMetadata":{"url":"/@athleanx","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCe0TLA0EsQbE-MjuHXevj2A","canonicalBaseUrl":"/@athleanx"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/Iz_-2YBK5LwyfrC-fbk1vbjCuMYLAwobmUbxTObYKPu9ceo7DeoljkExIuw9XBmLvUh7w8yy=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"Do you have a forward head or slumped posture that you wish you could fix?  If so, you will definitely want to watch this video.  I’m going to show you how to fix a forward head and rounded shoulders the right way by focusing on what is really causing these problems.  Here’s a hint.  If you followed other posture correction videos for a forward head you likely never fixed the root of the issue and only did a temporary solution.\n\n60% off all AX programs - http://athleanx.com/x/43-workouts\nSubscribe to this channel here -    / jdcav24  \n\nWhen trying to correct any issue in the body, it is good practice to not focus on the site of the issues when looking for the solution.  Instead, you need to look for the source.  For instance, when it comes to fixing the position of the head and neck you cannot just look at the muscles that surround the area for the answer to your problems.\n\nThis is especially true if you realize that the neck is just a portion of the spine.  The spine is an incredibly long structure that has elements in the neck, mid back and lower back.  Doing anything to a region of the spine down below is going to have repercussions on the levels above by virtue of the fact that it is one big interconnected chain.\n\nThat said, the positioning of the neck into a craned position is often the result of a compensation of the eyes to make sure we are looking straight ahead.  When the thoracic spine is excessively curved below we wind up rounding forward, with our head following.  This takes our eyesight line down towards the ground.  The craning of the neck back to horizontal is simply a reaction to the position of the thoracic rounding and not necessarily something in need of fixing directly.\n\nThe same can be said of the lumbar spine and pelvis.  If you place your pelvis into posterior tilt, you will affect the position of the thoracic spine as well.  This is once again due to the connectedness of the entire spine as a whole.  The key is to try and break this pattern up.  You want to reverse the excessive posterior tilt and restore lost extension into the thoracic spine.  When this happens, the cervical spine will often times correct itself.  \n\nTo work on doing this you will want to do the exercises shown here.  First, to mobilize the area of the thoracic spine that is most restricted while at the same time establishing proper pelvic position you would do the bench mobility combo demonstrated.  From here, you want to hold the position for a minute which is going to provide not just mobility to the tight areas but an isometric challenge to the deep flexors of the neck which tend to get weak over time from adaptations of the faulty posture.\n\nIf you’re just beginning, one minute three times per day of the first variation is enough.  If you are more advanced you can place the arms overhead for more of a thoracic mobility challenge.  Finally, the most advanced can add a weight plate to the front of the head for additional neck flexor strengthening.\n\nFinally, you want to reinforce the corrections you make with the use of a face pull overhead raise.  The addition of the overhead raise helps to hit the lower traps which will restore normal positioning of the shoulders and correct the forward rounding that promotes the neck adapatations in the first place.\n\nFor a complete program that puts the science back in strength, head to the link below and check out the ATHLEAN-X Training Programs.  Train like an athlete and overlook nothing in your workouts and nutrition.\n\nFor more videos on how to fix anterior pelvic tilts and the best way to get perfect posture, be sure to subscribe to our channel below and turn on your notifications so you never miss a new video when it’s published.","commandRuns":[{"startIndex":459,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBsQ040EGAQiEwjRlezYtu2HAxU0Ch4AHT3tBRZIt9Hj7-bKndpg","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbG5ZTXduTkp6dWVuYmFSeUI3SERMQUk1QXNIQXxBQ3Jtc0trMFI1djBwY0ozMWRLZmN2bF9kY0J2U3RkQTdoTzVLai1yVHlkN1JFWTFDTDdVZGVTTnFPRWIzQTE3MXEwaVpLV3p1dExJcEF6SjhlZlNZaXVYVDZYU2R0RlIzakVxd2lCdXlrZmp4eHByLXZzemptMA\u0026q=http%3A%2F%2Fathleanx.com%2Fx%2F43-workouts\u0026v=YLR2Vm346Lc","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbG5ZTXduTkp6dWVuYmFSeUI3SERMQUk1QXNIQXxBQ3Jtc0trMFI1djBwY0ozMWRLZmN2bF9kY0J2U3RkQTdoTzVLai1yVHlkN1JFWTFDTDdVZGVTTnFPRWIzQTE3MXEwaVpLV3p1dExJcEF6SjhlZlNZaXVYVDZYU2R0RlIzakVxd2lCdXlrZmp4eHByLXZzemptMA\u0026q=http%3A%2F%2Fathleanx.com%2Fx%2F43-workouts\u0026v=YLR2Vm346Lc","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":526,"length":14,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBsQ040EGAQiEwjRlezYtu2HAxU0Ch4AHT3tBRY=","commandMetadata":{"webCommandMetadata":{"url":"http://youtube.com/user/jdcav24","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"http://youtube.com/user/jdcav24","nofollow":true}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: jdcav24"}}}],"styleRuns":[{"startIndex":0,"length":459,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTER
